import React from 'react';

const AssetList = () => {
  const assets = [
    { id: 1, make: 'Toyota', model: 'Corolla', licensePlate: 'ABC123' },
    { id: 2, make: 'Ford', model: 'Focus', licensePlate: 'XYZ789' },
    // ... more hardcoded assets
  ];

  return (
    <div>
      <h2>Asset List</h2>
      <ul>
        {assets.map(asset => (
          <li key={asset.id}>
            {asset.make} {asset.model} - {asset.licensePlate}
            {/* Add buttons for view, edit, delete */}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AssetList;
